import React from 'react';
import { RadioGroup, Radio } from '@mantine/core';
import styled from 'styled-components';

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  margin: 2rem 20rem;
  gap: 40px;
  z-index: -20;
`;

const frontendQandA = [
  {
    question: 'Which is more important: flexibility, or comprehensiveness?',
    answer1: 'Flexibility',
    value1: [['React', 1]],
    answer2: 'Comprehensiveness',
    value2: [['Angular', 1]],
  },
  {
    question: 'Do you know or want to learn TypeScript?',
    answer1: 'Yes',
    value1: [['Angular', 1]],
    answer2: 'No',
    value2: [['Angular', -2]],
  },
  {
    question:
      'Which is more important: an easy learning curve or a robust ecosystem?',
    answer1: 'Learning curve',
    value1: [
      ['Svelte', 1],
      ['Vue', 1],
    ],
    answer2: 'Ecosystem/developer tooling',
    value2: [
      ['React', 1],
      ['Angular', 1],
    ],
  },
  {
    question: 'How important is performance (speed)?',
    answer1: 'The most important thing',
    value1: [
      ['Svelte', 2],
      ['Vue', 1],
    ],
    answer2: 'One factor among many',
    value2: [['React', 1]],
  },
  {
    question: 'Which is more important: current popularity or trajectory?',
    answer1: 'Current popularity',
    value1: [
      ['React', 2],
      ['Angular', 1],
      ['Vue', 1],
    ],
    answer2: 'Trajectory',
    value2: [['Svelte', 1]],
  },
];

const content = frontendQandA.map((el, index) => {
  let question = `${index + 1}. ${el.question} `;
  return (
    <fieldset>
      <legend>{question}</legend>
      <label for={el.answer1} name={el.question}>
        {el.answer1}
      </label>
      <input type="radio" id={el.answer1} name={el.answer1} value={el.value1} />
      <label for={el.answer2} name={el.question}>
        {el.answer2}
      </label>
      <input type="radio" id={el.answer2} name={el.answer2} value={el.value2} />
    </fieldset>
    // <RadioGroup
    //   label={question}
    //   description=""
    //   spacing="xl"
    //   color="cyan"
    //   required
    //   key={`frontendQ-${index}`}>
    //   <Radio value={el.value1} label={el.answer1} />
    //   <Radio value={el.value2} label={el.answer2} />
    // </RadioGroup>
  );
});

const FrontendContent = () => {
  return (
    <Wrapper>
      {content}
      <div>
        <input type="radio" id="dewey" name="drone" value="dewey" />
        <label for="dewey">Dewey</label>
      </div>
    </Wrapper>
  );
};

export default FrontendContent;
